import parse from 'html-react-parser'
import json from './Figures/countries.json'
var htmlDoc = {__html: Page}
var bgColors = { "Default": "#81b71a",
                    "Blue": "#00B1E1",
                    "Cyan": "#37BC9B",
                    "Green": "#8CC152",
                    "Red": "#E9573F",
                    "Yellow": "#F6BB42",
};


function App() {
  return (
    <div className="App">
      <h1>Test 1</h1>
      <div className="content">{parse(renderHTML())}</div>
    </div>
  );
}
function renderHTML() {
  console.log('Rendering HTML:')
  console.log(Page.substring(Page.length - 7))
