  // return Page
  return Page.substring(7, Page.length - 8)
}
function renderMap() {
  console.log(json)
  var figure = JSON.parse(json)
  var plot = Plotly.newPlot('graph-div', figure.data, figure.layout);
  return (
      <Plot
        data={[
          {
            x: [1, 2, 3],
            y: [2, 6, 3],
            type: 'scatter',
            mode: 'lines+markers',
            marker: {color: 'red'},
          },
          {type: 'bar', x: [1, 2, 3], y: [2, 5, 3]},
        ]}
        layout={{width: 320, height: 240, title: 'A Fancy Plot'}}
      />
    )
}
export default App;
